text:
The dangers our kids face on the internet recently devastated #KY02 when Eli Heacock, a 16 year old Kentuckian, took his own life after falling victim to an online extortion scheme.

@HouseCommerce is taking action to meaningfully protect our children online and honor the memories of young Americans like Eli.

Our community will forever remember the void left by his passing, and I am committed to putting an end to this deadly epidemic.
